Rules.InvariantScript:
Concurrent(
    Reset(cmbSystem),
    Reset(cmbEntityName),
    Reset(cmbAccCurr),
    Reset(cmbAccNo),
    Reset(cmbStatDate),
    Reset(cmbUserName)
);
Set(
    varSortBy,
    "SystemERP"
);
Set(
    varSortOrder,
    true
)

// Alphabetically sorting of uniqe values for combo box 
SortByColumns(
    Distinct(
            colReportedData,
        SystemERP
    ),
    "Result"
)

SortByColumns(
    Distinct(
        Filter(
            colReportedData,
            If(!IsEmpty(cmbSystem.SelectedItems),SystemERP in cmbSystem.SelectedItems, !IsBlank(SystemERP)
            )
        ),   
        BusinessUnit
    ),
    "Result"
)
